////
/// @group float
////

@mixin foundation-float-classes {
  .float-left {
    float: left !important;
  }

  .float-right {
    float: right !important;
  }

  .float-center {
    display: block;
    margin-right: auto;
    margin-left: auto;
  }

  .clearfix {
    @include clearfix;
  }
}

