.quiz {
    width: 100%;
    padding: 0 0 80px;
    position: relative;
    overflow: hidden;
    display: flex;
    flex-direction: column;
    justify-content: start;
    align-items: center;

    @include mq(large, 'max') {
        padding: 0 20px 80px;
    }


    .quiz-question-wrapper {
        width: 100%;
        height: auto;
        min-height: 400px;
        position: relative;
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
    }

    .quiz-progress {
        position: relative;
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        margin: 60px 0;
        width: 100%;
        max-width: 875px;

        .progress {
            margin-top: 20px;
            width: 100%;
            height: auto;
            max-width: 300px;
            margin-bottom: 0;
            background-color: transparent;

            .progress-meter {
                height: 13px;
                background-color: $green;
                transition: 1s ease-in-out;
            }
        }

        .back,
        .next {
            position: absolute;
            bottom: -5px;
            font-family: futura-pt,sans-serif;
            font-weight: 700;
            font-style: normal;
            font-size: 16px;
            text-transform: uppercase;
            cursor: pointer;

            @include mq(large, 'max') {
                bottom: initial;
                top: 0;
                font-style: normal;
                font-size: 13px;

                &::before {
                    top: 3px !important;
                }
            }

        }

        .back {
            left: 0;

            &::before {
                content: '';
                position: relative;
                top: 2px;
                width: 28px;
                height: 15px;
                display: inline-block;
                margin-right: 5px;
                background: url(../../../assets/images/arrow-left.svg);
                background-size: cover;
                background-repeat: no-repeat;
                background-position: center;
            }
        }

        .next {
            right: 0;
            margin: 0;

            &::after {
                content: '';
                position: relative;
                top: 2px;
                width: 28px;
                height: 15px;
                display: inline-block;
                margin-left: 5px;
                background: url(../../../assets/images/arrow-right.svg);
                background-size: cover;
                background-repeat: no-repeat;
                background-position: center;
            }
        }

        .counter {
            font-family: futura-pt,sans-serif;
            font-weight: 500;
            font-style: normal;
            font-size: 20px;
            text-transform: uppercase;
        }
    }

    .quiz-item {
        position: relative;
        top: 0;
        width: 872px;
        height: auto;
        opacity: 1;
        z-index: 1;
        visibility: visible;
        transition: .5s ease-in-out;
        transform: translateY(0);

        @include mq(large, 'max') {
            width: 90%
        }

        &.quiz-multiple-options {

            .question-container {
                @include mq(large, 'max') {
                    padding: 60px 30px !important;
                }
            }
            .option-headings {
                display: flex;
                align-items: center;
                justify-content: space-between;
                margin-bottom: 10px;

                .label-heading, .labels {
                    text-transform: uppercase;
                }

                .labels {
                    text-align: center;

                    span {
                        display: inline-block;
                        width: 100px;

                        @include mq(large, 'max') {
                            font-size: 13px;
                            width: 60px;
                        }
                    }
                }
            }

            .form-wrapper {
                display: flex;
                justify-content: space-between;
                align-items: center;
                width: 100%;

                .title {
                    font-family: futura-pt,sans-serif;
                    font-weight: 400;
                    font-style: normal;
                    font-size: 22px;
                }

                label {
                    display: flex;
                    justify-content: center;
                    width: 100px;
                    text-align: center;
